<template>
  <div class="container-block">
    <image class="circle-bg" :src="circleBG"></image>
    <image class="center-bg" :src="centerBG"></image>
    <text class="des-text" :style="{ left: '326px' }">当前亮度</text>

    <image
      class="blade"
      :src="bladeDown"
      v-for="i in 10"
      :key="i"
      :style="{ transform: 'rotate(' + (i - 1) * 18 + 'deg)' }"
    ></image>
    <image
      class="blade"
      :src="bladeUp"
      v-for="i in 10"
      :key="i"
      :style="{ transform: 'rotate(' + (i - 1) * 18 + 'deg)', opacity: i > tabCircleIndex ? 1 : 0 }"
    ></image>
    <image class="needle" :src="needleImg" :style="{ transform: 'rotate(' + ((11 - envIndex) * 18.4 - 100) + 'deg)' }"></image>
    <image
      class="tab-circle"
      :src="tabCircleImg"
      :style="{ transform: 'rotate(' + (tabCircleIndex * 17.8 + 1) + 'deg)' }"
    ></image>

    <mdiea-arc-slider
      :class="[isIOS ? 'circle-progress-ios' : 'circle-progress']"
      :data="chartJson"
      @onProgress="onProgress"
      @endProgress="endProgress"
    >
    </mdiea-arc-slider>

    <text class="des-text" :style="{ left: '130px' }">环境较亮</text>
    <text class="des-text" :style="{ right: '130px' }">环境较暗</text>
  </div>
</template>

<script>
export default {
  name: 'circleIlluminationBar',
  props: {
    index: {
      // 1 ~ 9
      type: Number,
      default: 3
    },
    envIndex: {
      // 1 ~ 10
      type: Number,
      default: 1
    }
  },
  data () {
    return {
      circleBG:
        'data:image/png;base64,',
      centerBG:
        'data:image/png;base64,',
      bladeDown:
        'data:image/png;base64,',
      bladeUp:
        'data:image/png;base64,',
      needleImg:
        'data:image/png;base64,',
      tabCircleImg:
        'data:image/png;base64,',
      tabCircleIndex: 0,
      chartJson: {
        completedColor: '#d4e6ff', //环形进度条完成后的颜色, 默认#267AFF
        incompletedColor: '#d4e6ff', //环形进度条未完成后的颜色，默认透明
        thickness: 40, //环形进度条宽度，默认4
        totalCounter: 100, //环形进度条的最大值，默认是360
        progressCounter: 50, //设置进度值，默认是从0-360, 默认为0
        padding: 20, //可增加滑动手势的影响范围，圆环距离容器的边界，默认为0
        startingSlice: -90, //弧线进度开始的起始位置，0: 0点钟位置起点，90:3点钟位置起点 180:6点钟位置起点
        endingSlice: 90 //弧线进度结束时候的位置
      },
      isTouching: false
    }
  },
  watch: {
    index () {
      let temp = this.index < 1 ? 1 : this.index > 9 ? 9 : this.index
      this.tabCircleIndex = 10 - temp
    }
  },
  computed: {
    isIOS () {
      const { platform } = weex.config.env
      return platform.toLowerCase() === 'ios'
    }
  },
  methods: {
    progress2Index (pro) {
      let temp = parseInt(pro / 10) + (pro % 10 > 5 ? 1 : 0)
      return temp <= 1 ? 1 : temp >= 9 ? 9 : temp
    },
    onProgress (e) {
      let progress = parseInt(e.progress)
      if (!this.isTouching) {
        // 开始范围限制
        let start = (this.tabCircleIndex <= 1 ? 1 : this.tabCircleIndex - 1) * 10
        let end = (this.tabCircleIndex >= 9 ? 9 : this.tabCircleIndex + 1) * 10
        if (progress < start || progress > end) return
      }
      this.isTouching = true
      this.tabCircleIndex = this.progress2Index(progress)
      this.$emit('updateValue', 10 - this.tabCircleIndex)
    },
    endProgress () {
      if (this.isTouching) this.$emit('slideEnd', 10 - this.tabCircleIndex)
      this.isTouching = false
    }
  },
  created () {
    let temp = this.index < 1 ? 1 : this.index > 9 ? 9 : this.index
    this.tabCircleIndex = 10 - temp
  }
}
</script>

